void addToScreen(char toAdd[32][128])
{
    int i, j;
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            if (toAdd[i][j] == 1)
            {
                Screen[i][j] = 1;
            }
        }
    }
}

void removeFromScreen(char toRemove[32][128])
{
    int i, j;
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            if (toRemove[i][j] == 1)
            {
                Screen[i][j] = 0;
            }
        }
    }
}

void update_screen()
{
    translate_image(Screen);
    render_image(DrawingScreen);
}

void clearScreen()
{
    int i, j;
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            Screen[i][j] = 0;
        }
    }
}

void debug_image(char toDebug[32][128])
{
    int i, j;
    printf("\n");
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            if (toDebug[i][j] == 1)
            {
                printf(" ");
            }
            else
            {
                printf("#");
            }
        }
        printf("\n");
    }
}

void testStuff()
{
    printf("Empty screen");
    debug_image(Screen);
    addToScreen(LeftManualArrow);
    printf("\nScreen with left manual arrow");
    debug_image(Screen);
    addToScreen(RightAutomaticArrow);
    printf("\nScreen with left manual arrow and right automatic arrow");
    debug_image(Screen);
    update_screen();
    clearScreen();
    printf("\nEmpty screen");
    debug_image(Screen);
}
// translate into format render_image can understand
void translate_image(char toTranslate[32][128])
{
    // init loop values
    int i, j, k;
    int placement_index = 0;
    // iterating over the 4 segments of the column
    for (i = 0; i < 4; i++)
    {
        // control segments added
        int index_start, index_end;
        if (i == 0)
        {
            index_start = 0;
            index_end = 7;
        }
        else if (i == 1)
        {
            index_start = 8;
            index_end = 15;
        }
        else if (i == 2)
        {
            index_start = 16;
            index_end = 23;
        }
        else if (i == 3)
        {
            index_start = 24;
            index_end = 31;
        }

        // iterating over columns
        for (j = 0; j < 128; j++)
        {

            int n = 0;
            for (k = index_start; k < index_end; k++)
            {
                // clear bit if zero
                if (toTranslate[k][j] == (char)0)
                {
                    DrawingScreen[placement_index] &= ~((char)1 << n);
                }
                // set bit if 1
                if (toTranslate[k][j] == (char)1)
                {
                    DrawingScreen[placement_index] |= (char)1 << n;
                }
                n++;
            }

            placement_index++;
        }
    }
}